int maxFrequencyElements(int* nums, int numsSize) {
    int frequency[101] = {0}; // Initialize frequency array
    int maxFreq = 0;
    int count = 0;

    // Counting the frequency of each element
    for (int i = 0; i < numsSize; i++) {
        frequency[nums[i]]++;
        if (frequency[nums[i]] > maxFreq) {
            maxFreq = frequency[nums[i]];
        }
    }

    // Counting how many elements have the maximum frequency
    for (int i = 0; i < 101; i++) {
        if (frequency[i] == maxFreq) {
            count += maxFreq;
        }
    }

    return count;
}
